- input: "TEXT\x1CC00010439\x1CX0\x1C\x1CF3XA\x1CThis amendment responds to FEC letter
    dated February 18, 2011.  Issue 1.  All disbursements on Schedule B Line 30(b)
    that are identical to disbursements disclosed on Schedule F are correct.  These
    expenditures are hybrid expenditures.  The portion of the expenditure reported
    on Schedule F is the portion allocated to expenditures in connection with the
    general election campaign of Walt Minnick.  The remaining portion of the expenditures
    is Federal Elections Activity expenditures not allocable to a federal candidate.
    \ See FEC advisory opinion 2006-11.    Issue 2.  All Line 30 (b) expenditures
    for GOTV minutes, Literature and Robo Calls have been clarified and are not expenditures
    for public communications that refer to a federal candidate.  Issue 3.  Disbursements
    on Schedule B for Line 30 (b) for Contract Labor and Literature have been clarified
    to describe the specific purpose.    All employee salaries, benefits, payroll
    taxes, insurance, and reimbursed expenses for employees who spend >25% of the
    month on Federal election activities are paid entirely with Federal funds and
    the expenses are reported on Line 30(b).  All other employee costs are shared
    Federal/Non Federal activities.                                                                                                          \n"
