      \ The remaining portion of the expenditures is Federal Elections Activity expenditures
      not allocable to a federal candidate.  See FEC advisory opinion 2006-11.    Issue
      2.  All Line 30 (b) expenditures for GOTV minutes, Literature and Robo Calls
      have been clarified and are not expenditures for public communications that
